import React from "react";

const UserItem = ({user}) => {
    return (
        <tr>
            <td>{user.first_name}</td>
            <td>{user.last_name}</td>
            <td>{user.birthday_year}</td>
        </tr>
    )
}
const UserList = ({users}) => {
    return (
        <table>
            <tr>
            <th>Firstname</th>
            <th>Lastname</th>
            <th>Birthday Year</th>
            </tr>

            {users.map((user) => <UserItem user={user} key={user.id.toString()}/>)}
        </table>
    )
}
export default UserList
